import React from 'react';
import Icon from './circle-user-solid.svg';
import './style.css'

const login = () => {
    return (
        <div className="main-login">
            <div className="sign-in-content">
                <img src={Icon} alt="user icon" className='icon-user' />
                <h1>Sign In</h1>
            </div>
        </div>
    );
};

export default login;
